import React from "react";
import images1 from "../img/images1.jpg";
import images2 from "../img/images2.webp";
import images3 from "../img/images3.jpeg";

const Testimotial = () => {
  return (
    <>
      <div>
        <div>
          <img
            src='https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/640px-HTML5_logo_and_wordmark.svg.png'
            alt="images1"
            style={{ width: "30%", height: "30%" }}
          />
          <div>
            <p>Lorem ipsum dolor sit amet, consectetur</p>
          </div>
        </div>
        <div>
          <img
            src={images1}
            alt="images1"
            style={{ width: "30%", height: "30%" }}
          />
          <div>
            <p>Lorem ipsum dolor sit amet, consectetur</p>
          </div>
        </div>
      </div>
    </>
  );
};

export default Testimotial;
